import React from "react";
import "./App.css";

const videoData = [
  {
    id: 523523,
    title: "Never Gonna Give You Up",
    url: "https://www.youtube.com/watch?v=dQw4w9WgXcQ",
    rating: 23,
  },
  // ... (rest of the video data)
];

function App() {
  return (
    <div className="App">
      <h1>Video List</h1>
      <div className="video-list">
        {videoData.map((video) => (
          <div key={video.id} className="video-item">
            <h2>{video.title}</h2>
            <iframe
              title={video.title}
              width="560"
              height="315"
              src={video.url}
              frameborder="0"
              allowfullscreen
            ></iframe>
            <p>Rating: {video.rating}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
